demo.repl.help:
ലഭ്യമായ കമാൻഡുകൾ:
  @show              ─ അവസാന അഡാപ്റ്റീവ് കാർഡ് സംഗ്രഹം കാണിക്കുക
  @json              ─ ഫ്ലോയിൽ നിന്ന് ലഭിച്ച അസംസ്കൃത JSON മൂല്യം പുറപ്പെടുവിക്കുക
  @back              ─ മുൻപ് തടഞ്ഞ കാർഡ്/ഇൻപുട്ടുകളിലേക്ക് മടങ്ങുക
  @input <k>=<v>     ─ ഒരു ഇൻപുട്ട് ഫീൽഡ് സജ്ജമാക്കുക അല്ലെങ്കിൽ മേൽെഴുതുക
  @click <action_id> ─ നൽകിയ പ്രവർത്തനത്തോടെ കാർഡ് സമർപ്പിക്കുക
  @help              ─ ഈ സഹായ വാചകം അച്ചടിക്കുക
  @quit              ─ REPLൽ നിന്ന് പുറത്തുകടക്കുക
